import React from 'react';
import ReactDOM from 'react-dom';
import * as serviceWorker from './serviceWorker';

import './css/index.css';
import CardEditorWrapper from './components/CardEditor/CardEditorWrapper.js';

import { Font } from '@react-pdf/renderer';

//import and register fonts
import InterstateExtraLightCondensed from "./css/Interstate-ExtraLight-Cond.ttf";
import GenShinGothic from "./css/GenShinGothic-Monospace-ExtraLight.ttf";
Font.register({
  family: 'Interstate Extra Light Condensed',
  fontStyle: 'normal',
  fontWeight: 'normal',
  src: InterstateExtraLightCondensed
});
Font.register({
  family: 'Genshin Gothic Monospace ExtraLight',
  fontStyle: 'normal',
  fontWeight: 'normal',
  src: GenShinGothic
});

ReactDOM.render(
  <React.StrictMode>
    <CardEditorWrapper/>
  </React.StrictMode>,
  document.getElementById('sharehome')
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
